import Header from '../components/Header';
import Card from '../components/Card'

function Service() {
    return (
        <>
            <Header />
            <div className='container mx-auto'>
                <div className='grid grid-cols-3 gap-x-20 lg:gap-10 h-screen mx-8 mt-8 w-2.5 bg-gray-300 rounded-full'>
                    <div className='absolute w-2.5 bg-indigo-500 rounded-full' style={{ height: `40%` }}></div>
                    <Card />

                </div>

            </div>
        </>
    )
}

export default Service;
